import React from 'react';
import {FooterContacts, FooterTitle, StyledFooter} from "./style";

function Footer() {
  return (
    <StyledFooter>
      <FooterContacts>
        <FooterTitle>Contact Us</FooterTitle>
        
      </FooterContacts>
    </StyledFooter>
  );
}

export default Footer;
